/**
 * Task 3: output list 
 */
import { useState } from "react";
export const Task3 = () => {
    const [data, setData] = useState([
        { id: 1, title: 'DoXuanTrong', body: 'dev' },
        { id: 2, title: 'Olala', body: 'dev' },
        { id: 3, title: 'Hope', body: 'dev' },
    ])
    return (
        <div>
            task 3
            {data.length && data.map(item => {
                <div key={item.id}>
                    <p>{item.title}</p>, <small>{item.body}</small>
                </div>
            })}
        </div>
    )
}
